import React, { Component } from 'react';
import { Butt_Remv } from '../components/Butt_Remv';
import { MdRemove, MdPlaylistAdd } from 'react-icons/md';

export default class Poll_List extends Component {
	render() {
		const {ulist}=this.props;
		return (
			<div>
				<span className="input-group mb-1">
	                <ul className="ulist">
	                  {this.state.listQ.map(item => {
	                    return (
	                      <li key={item.id}>
	                        <input className="list" 
	                        type="text" 
	                        value={item.value} 
	                        readOnly="readOnly"/>
	                        <Butt_Remv onClick={() => this.deleteItem(item.id)}>
	                          <MdRemove/>
	                        </Butt_Remv>
	                      </li>
	                    );
	                  })}
	                </ul>
	            </span>
			</div>
		)
	}
}
